import PropTypes from "prop-types";

function MakeDetail({ movie }) {
  console.log(movie);
  const onClick = () => {
    location.href = "https://yts.mx/movies/love-li-2024";
  };
  return (
    <div>
      <img src={movie.medium_cover_image} />
      <h2>{movie.title_long}</h2>
      <button>Goto Watch!</button>
      <h4>rating : {movie.rating}</h4>
      <h4>running time : {movie.runtime}mins</h4>
      <h4>genres</h4>
      <ul>
        {movie.genres.map((genre, idx) => (
          <li key={idx}>{genre}</li>
        ))}
      </ul>
      <p>discrption : {movie.discription_full}</p>
      <br />
    </div>
  );
}

export default MakeDetail;
